class HeatmapChartData:
    def __check_data(self, data):
        ...

    def wrapper_chart(self, dd: typing.Tuple[str, str, str]):
        assert len(dd) == 3 and isinstance(dd, tuple)
        xdata, ydata, values = dd
        # mylogger.debug(xdata)
        # mylogger.debug(ydata)
        data = {'xdata': xdata, 'ydata': ydata, 'values': values, 'columns': [], 'min': min([item[2] for item in values]), 'max': max([item[2] for item in values])}
        df = pd.DataFrame(data, index=xdata)
        data = {'code': 200, 'data': data}
        json_response = json.dumps(data, ensure_ascii=False)
        return json_response

    def wrapper_table(self, dd: typing.Tuple[str, str, str]):
        assert len(dd) == 3 and isinstance(dd, tuple)
        xdata, ydata, values = dd
        # mylogger.debug(xdata)
        # mylogger.debug(ydata)
        i1 = xdata * len(ydata)
        i2 = ydata * len(xdata)
        index = [i1, i2]
        # mylogger.debug(len(i1), len(i2), len(index), len(values))
        data = {'i1': i1, 'i2': i2, 'value': [item[2] for item in values]}
        df = pd.DataFrame(data, index=index)

        data = {'index': df.index.tolist(), 'columns': df.columns.tolist(), 'values': df.values.tolist()}
        self.__check_data(data)
        data = {'code': 200, 'data': data}
        json_response = json.dumps(data, ensure_ascii=False)
        return json_response

    def CartesianHeatmapChart(self):
        xdata = [f'{i}点' for i in range(24)]
        ydata = ['周一', '周二', '周三', '周四', '周五', '周六', '周日']
        values = [[j, i, np.random.randint(0, 100)] for i in range(len(ydata)) for j in range(len(xdata))]
        return (xdata, ydata, values)

    def PieceWiseHeatmapChart(self):
        xdata = [f'{i}点' for i in range(24)]
        ydata = ['周一', '周二', '周三', '周四', '周五', '周六', '周日']
        values = [[j, i, np.random.randint(0, 100)] for i in range(len(ydata)) for j in range(len(xdata))]
        return (xdata, ydata, values)


