class SankeyChartData:
    def __check_data(self, data):
        ...

    def wrapper_chart(self, dd):
        data, links = dd
        data = {'data': data, 'links': links}
        self.__check_data(data)
        data = {'code': 200, 'data': data}
        json_response = json.dumps(data, ensure_ascii=False)
        return json_response

    def SimpleSankeyChart(self):
        data = [{"name": "a", }, {"name": "b", }, {"name": "a1", }, {"name": "a2", }, {"name": "b1", }, {"name": "c", }, ]
        links = [{"source": "a", "target": "a1", "value": 5, }, {"source": "a", "target": "a2", "value": 3, }, {"source": "b", "target": "b1", "value": 8, }, {"source": "a", "target": "b1", "value": 3, },
                 {"source": "b1", "target": "a1", "value": 1, }, {"source": "b1", "target": "c", "value": 2, }, ]
        return (data, links)


