def gendata(style, chartid, datafile_id):
    if chartid.startswith('/'):
        chartid = chartid[1:]

    if 'line/' in chartid:
        chartData = LineChartData()
    elif 'bar/' in chartid:
        chartData = BarChartData()
    elif 'pie/' in chartid:
        chartData = PieChartData()
    elif 'scatter/' in chartid:
        chartData = ScatterChartData()
    elif 'radar/' in chartid:
        chartData = RadarChartData()
    elif 'heatmap/' in chartid:
        chartData = HeatmapChartData()
    elif 'graph/' in chartid:
        chartData = GraphChartData()
    elif 'tree/' in chartid:
        chartData = TreeChartData()
    elif 'parallel/' in chartid:
        chartData = ParallelChartData()
    elif 'sankey/' in chartid:
        chartData = SankeyChartData()
    elif 'funnel/' in chartid:
        chartData = FunnelChartData()
    elif 'river/' in chartid:
        chartData = RiverChartData()
    elif 'wordcloud/' in chartid:
        chartData = WordCloudChartData()
    elif 'map/' in chartid:
        chartData = MapChartData()
    elif 'polar/' in chartid:
        chartData = PolarChartData()

    subchart = chartid.split('/')[1]
    mylogger.debug(f'{chartid=}', f'{subchart=}')
    assert hasattr(chartData, subchart)
    df = getattr(chartData, subchart)(datafile_id)

    if style == 'chart':
        json_response = chartData.wrapper_chart(df)
    elif style == 'table':
        json_response = chartData.wrapper_table(df)
    return json_response
